import React from 'react'
import TodoList from './Todo/TodoList'
import MyHeroes from './Todo/MyHeroes'

function App() {
  const todos = [
    {id: 1, completed: false, title: "Buy milk"},
    {id: 2, completed: false, title: "Buy coffee"},
    {id: 3, completed: false, title: "Buy sugar"}
  ]

  function toggleTodo(id) {
    console.log('todo id ', id)
  }

  return (
    <div className="wrapper">
     <h1 className="heading">Secret Door</h1>
     <TodoList todos={todos} onChange={toggleTodo} />
     <MyHeroes />
    </div>
  );
}

export default App;
